/* The type of a ucdb entry */
struct ucdb_entry
{
	uchar_t codepoint : UNIC_BIT;
	enum unic_gc class : UNIC_GC_BITS;

	signed int uppercaseDelta : 17;
	signed int lowercaseDelta : 17;
} __attribute__((packed));

